import axios from 'axios';

export function getEnderecoPorCep(cep, lista){
    try {

       axios.get(`https://viacep.com.br/ws/${cep}/json/`).then((response) =>{
         const dados = response.data;
         const cep = dados.cep;
         lista.push(cep)
       });
    } catch (error) {

      console.error(error);
    }
  }
